import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from "react-dom";
import Home from "./Home/homepage.jsx";

function App() {
  return (
    <Router>
      <header>
        <nav>
          <li>
            <Link to={"/"}>Home</Link>
          </li>
        </nav>
      </header>

      <Switch>
        <Route path="/" exact component={Home} />
      </Switch>
    </Router>
  );
}

export default App;
